import React, { useState } from "react";
import {scroll, banner1, banner2, banner3} from '../assets/export'
import '../index.css'
import {AiFillCaretLeft, AiFillCaretRight } from 'react-icons/ai'

const Carousel = () => {
    return (
      <>
          <section>
            <ul>
              <li className="slide">
                <img src={banner1} alt="banner" />   
              </li>   
            </ul>   
          </section>  
      </>
    )
};

export default Carousel;
